import * as React from "react";
import ManufacturerModal from "components/manufacturer_modal/manufacturerModal";
import useModal from "components/modal/Modals";

const App = () => {
  const {isVisible, toggleModal} = useModal();

  return (
    <div>
      <button onClick={toggleModal}>
        Show modal
      </button>
      <Modal isVisible={isVisible} hideModal={toggleModal} />
    </div>
  );
};
export default App;
